import React, { Component } from 'react'
import { BrowserRouter, Route } from "react-router-dom"
import './index.css';
import Home from './components/Home';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Entertainment from './components/Entertainment';
import LodgAndTran from './components/LodgAnTran';
import FoodAnDrinks from './components/FoodAnDrinks';
import Events from './components/LodgAnTran';



class App extends Component {
  render () {
    return (
      <BrowserRouter>
        <Navbar />

          <Route exact path='/' component={ Home }/>
          <Route  path='/FoodAnDrinks' component={ FoodAnDrinks }/>
          <Route  path='/Events' component={ Events }/>
          <Route  path='/Entertainment' component={ Entertainment }/>
          <Route  path='/LodgAnTran' component={ LodgAndTran }/>
          <Route  path='/About' component={ About }/>
          <Route  path='/Contact' component={ Contact }/>


        <Footer />
      </BrowserRouter>

    )
  }
}

export default App;
